import React, { useState } from "react";
import Navbar from "../components/NavBar";
import Sidebar from "../components/SideBar";

const Home = () => {
  //toggels navbar
  const [isOpen, setIsOpen] = useState(false);

  const toggle = () => {
    setIsOpen(!isOpen);
  };

  return (
    <>
      <Sidebar isOpen={isOpen} toggle={toggle} />
      <Navbar toggle={toggle} />
    </>
  );
};

export default Home;
